import { Route } from "react-router";
import "./App.css";
import Body from "./components/UI/Body";
import Footer from "./components/UI/Footer";

function App() {
  return (
    <div className="App">
      <Route path="/dqmc">
        <Body />
        <Footer />
      </Route>
    </div>
  );
}

export default App;
